/*Settings should allow scaling. The current implementation
 works for well for scale 1 and 0.5. Scale 1 is for normal screens
 and 0.5 is for small android screens. On android 2.x wrt we can not scale
 effectively and this is why we cancel the scale function and set the
 0.5 graphics instead. */
Settings = function (scale) {
    return { // All settings are gathered here in order to change them in on place
        isScaled:!(scale == 1), //Indicate if scale has been applied to default settings. This is used when we can't use Crafty's scale, aka webinos android wrt
        webinos:{
            BroadcastEvery:5 // Broadcast every x sec
        },
        GameTime:120, //in secs
        HeaderArea:{
            x:Math.floor(20 * scale),
            y:Math.floor(10 * scale),
            w:Math.floor(440 * scale),
            h:Math.floor(60 * scale)
        },
        HeaderFontSize:Math.floor(40 * scale) + "px",
        LetterFontSize:Math.floor(55 * scale) + "px", // The font size of each letter
        LetterSpacing:Math.floor(10 * scale), //The distance between each letter
        StackLocation:{// The bottom left corner of the letter stack
            x:Math.floor(20 * scale),
            y:Math.floor(209 * scale)
        },
        WordLocation:{ // The bottom left corner of the word placeholder
            x:Math.floor(20 * scale),
            y:Math.floor(371 * scale)
        },
        Sprites:{
            Letter:{
                // Webinos PZP has a policy to expire content instantly which makes the
                // images to be reloaded everytime if not embedded
                src:'data:image/gif;base64,' + (scale == 1 ? '' : ''),
                w:Math.floor(64 * scale),
                h:Math.floor(64 * scale)
            },
            Button:{
                src:'data:image/gif;base64,' + (scale == 1 ? '' : ''),
                w:Math.floor(218 * scale),
                h:Math.floor(64 * scale)
            },
            Hosts:{ // The loader will be the same for all resolutions
                src:'data:image/gif;base64,' + (scale == 1 ? '' : ''),
                w:Math.floor(361 * scale),
                h:Math.floor(64 * scale),
                fontSize:Math.floor(20 * scale) + "px", //The font size to show the host
                maxLength:25, // Max number of letters to show
                marginTop:Math.floor(20 * scale) // Margin for the letters
            },
            HostSelected:{
                x:0, //Relative to host
                y:0, // --//--
                w:Math.floor(64 * scale),
                h:Math.floor(64 * scale),
                src:'data:image/gif;base64,' + (scale == 1 ? '' : '')
            },
            HostSelection:{
                x:0, //Relative to host
                y:0, // --//--
                w:Math.floor(64 * scale),
                h:Math.floor(64 * scale),
                src:'data:image/gif;base64,' + (scale == 1 ? '' : '')
            }
        },
        PlayersScore:{
            fontSize:Math.floor(20 * scale) + "px", //The font size to show the scores
            h:Math.floor(30 * scale) //And their height, they will be from one side to the side so no width
        },
        BackgroundUrl:'background' + (scale == 1 ? '' : scale) + '.png',
        CanvasSize:{ // The game area size
            w:Math.floor(480 * scale),
            h:Math.floor(800 * scale)
        },
        ButtonsSize:{
            w:Math.floor(217 * scale),
            h:Math.floor(64 * scale),
            textTopOffset:Math.floor(20 * scale)
        },
        ButtonsFontSize:Math.floor(20 * scale) + "px",
        ButtonLocations:{
            RemoveSpace:{
                x:Math.floor(15 * scale),
                y:Math.floor(420 * scale)
            },
            CheckWord:{
                x:Math.floor(250 * scale),
                y:Math.floor(420 * scale)
            },
            SuffleLetters:{
                x:Math.floor(15 * scale),
                y:Math.floor(60 * scale)
            },
            BackToMenu:{
                x:Math.floor(250 * scale),
                y:Math.floor(60 * scale)
            },
            SinglePlayer:{
                x:Math.floor(130 * scale),
                y:Math.floor(30 * scale)
            },
            HostGame:{
                x:Math.floor(15 * scale),
                y:Math.floor(460 * scale)
            },
            JoinGame:{
                x:Math.floor(250 * scale),
                y:Math.floor(460 * scale)
            },
            MainMenu:{
                x:Math.floor(15 * scale),
                y:Math.floor(460 * scale)
            },
            StartJoinGame:{
                x:Math.floor(250 * scale),
                y:Math.floor(460 * scale)
            }
        },
        RenderingTechnology:"DOM" //We can either render in the canvas or use DOM elements which I selected for compatibility.
    };
};

